import React from 'react';
import './Tutorial.css';

function Tutorial() {
    return(
        <div className="tutorial">
        <iframe title="Tutorial Video" style={{position: 'absolute', top: '0', left: '0', width: '100%', height: '100%'}} src="https://www.youtube.com/embed/k4NTf0hMjtY?start=114" frameBorder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowFullScreen></iframe>
      </div>
    );
}

export default Tutorial
